import MoreInputs from "./MoreInputs";

const MasterMindInputRow = (props) => {
    return (
        <div>
            <form onSubmit={props.checkRow}>
                <input type="text" id={`${props.rowId}+Col1`}/>
                <input type="text" id={`${props.rowId}+Col2`}/>
                <input type="text" id={`${props.rowId}+Col3`}/>
                <input type="text" id={`${props.rowId}+Col4`}/>
                <MoreInputs />
                <input type="submit"/>
            </form>
        </div>
    )
}

export default MasterMindInputRow;
